import React, {useState} from "react";
import ProjectCard from "./ProjectCard";

function YourProjects({ user, userTabs, setProjectToView }) {
    const [search, setSearch] = useState("")

    const filteredProjects = userTabs ? userTabs.filter((tab) => {
        return tab.title.toLowerCase().includes(search.toLowerCase())
    }) : null

    const projectsToDisplay = userTabs ? userTabs.map((tab) => {
        return <ProjectCard key={tab.id} user={user} tab={tab} setProjectToView={setProjectToView} />
    }) : null

    return (
        <div className="flex mt-10 flex-col w-screen justify-center items-center">
            <form>
            <input type="text" placeholder="Search" class="bg-gray-700 text-white px-4 py-2 rounded-md border border-gray-600 focus:outline-none focus:border-gray-400" />
            </form>
            <div className="flex flex-wrap mt-10">
                {projectsToDisplay}
            </div>
        </div>
    )
}

export default YourProjects;
